function getCourseInfo(elem) {
    /*
        :return CNAME+CID
    */
    // console.log(elem);
    var link = elem.children[0] // <tr class = 'datagrid'>
        .children[0] // <a href>
        .children[0]; // <span>...</span>
    var cid = elem.children[5] // <tr class = 'datagrid'>
        .children[0]; // <span>...</span>
    return [link.innerHTML, cid.innerHTML];
}

function getCourse(elem, course_name, class_id) {
    var [cname, cid] = getCourseInfo(elem);
    return (cname === course_name && cid === String(class_id));
}

function getHref(elem) {
    var href = elem.children[10] // <tr class = 'datagrid'>
        .children[0]; // <a href>
    return href;
}

function getLinkAvailability(link) {
    return link.children[0].innerHTML === "补选";
}

function handleClick(targets, anchors) {
    console.assert(targets.length === anchors.length, "Targets and anchors size mismatch");
    var target = targets[handleClickId];
    var anchor = anchors[handleClickId];
    var [cname, cid] = getCourseInfo(target);
    current_course_name = cname;
    current_cid = cid;
    console.log(`Selecting #${handleClickId}: ${cname}, ${cid}`);
    anchor.click();
    handleClickId = (handleClickId + 1) % targets.length;
}

function playSound(base64, loop = false, times = 0) {
    if (times > 0) {
        for (var i = 0; i < times; i++) {
            // play for times each 2 sec
            var snd = new Audio("data:audio/wav;base64," + base64);
            setTimeout(() => snd.play(), timeout = 2000);
        }
        return snd;
    } else {
        var snd = new Audio("data:audio/wav;base64," + base64);
        snd.loop = loop;
        snd.play();
        return snd;
    }
}

function sendNotification(msg=null) {
    if (msg === null) {
        msg = "课程有空余名额啦, 快来选课!";
    }
    // replace space with "+", in case the sent url is ill-formed
    msg = encodeURIComponent(msg.replace(/ /g, '+'));
    // notify
    GM_xmlhttpRequest(
        {
            method: 'POST',
            url: `https://sctapi.ftqq.com/${send_key}.send`,
            headers: {
                'User-Agent': 'Mozilla/4.0 (compatible) Greasemonkey',
                'Content-type': 'application/x-www-form-urlencoded'
            },
            data: `title=选课姬&desp=${msg}`,
            onload: () => {
                console.log('Successfully sent: ' + msg);
            }
        }
    );
    // console.log(msg);
}

// direct copy from https://stackoverflow.com/a/934925
function getBase64Image(img) {
    // Canvas draw policy

    // Create an empty canvas element
    var canvas = document.createElement("canvas");
    canvas.width = img.width;
    canvas.height = img.height;

    // Copy the image contents to the canvas
    var ctx = canvas.getContext("2d");
    ctx.drawImage(img, 0, 0);

    // Get the data-URL formatted image
    // Firefox supports PNG and JPEG. You could check img.src to
    // guess the original format, but be aware the using "image/jpg"
    // will re-encode the image.
    var dataURL = canvas.toDataURL("image/png");
    return dataURL;
    return dataURL.replace(/^data:image\/(png|jpg);base64,/, "");
}

// direct copy from https://stackoverflow.com/a/42916772
function toDataURL(url, callback) {
    // use request again policy
    // NOTE: sadly server-side does not support GIF/animated JPEG
    var xhr = new XMLHttpRequest();
    xhr.open('get', url);
    xhr.responseType = 'blob';
    xhr.onload = function () {
        var fr = new FileReader();

        fr.onload = function () {
            callback(this.result);
        };

        fr.readAsDataURL(xhr.response); // async call
    };

    xhr.send();
}

function getVerificationImage(callback) {
    // use cached first
    if(global_verify !== null) {
        callback(global_verify);
        return;
    }

    let verification = $('#imgname')[0];
    let base64img = "";
    
    // use libgif-js to get frames
    // in case not to corrupt original gif, add a invisible copy
    let tmp = verification.cloneNode(true);
    tmp.visibility = false;
    document.body.appendChild(tmp);
    let rub = new SuperGif({
        gif: tmp,
        auto_play: false,
        loop_mode: true,
    });
    rub.load(() => {
        console.log("验证码GIF已加载");
        rub.play();
        rub.pause();
        console.log(rub.get_length());
        rub.move_to(rub.get_length() - 1);
        encoded_verify = rub.get_canvas().toDataURL("image/png");
        callback(encoded_verify);
    });

    return base64img;
}

function getVerificationCode(callback) {
    // console.log("Trying retrive!");
    GM_xmlhttpRequest(
        {
            method: 'GET',
            url: server_url,
            headers: {
                'User-Agent': 'Mozilla/4.0 (compatible) Greasemonkey',
            },
            onload: (response) => {
                let msg = response.responseText;
                console.log('Successfully retrieved: ' + msg);
                callback(msg);
            }
        }
    );
}

function setVerify(code){
    $('#validCode')[0].value = code;
}

function waitClick(elem, delay=3000){
    return new Promise(resolve => {
        setTimeout(() => {
            elem.click();
            resolve('result');
        }, delay);
    });
}

